(162, 1, '2018-02-19 19:13:57', '2018-02-19 19:13:57', '<div class="main_pop_x">\r\n   <div class="left_pop_side">\r\n      <h1>\r\n      Первый день</h1>\r\n      <h3>Теория</h3>\r\n      <div class="left_pop_side_ul">\r\n         <ul>\r\n            <li>Знакомство с профессией преподавателя. Построение образа успешного инструктора</li>\r\n            <li>Разработка программы обучения</li>\r\n            <li>Работа над учебными материалами: методическими пособиями, планами занятий. Поиск моделей и учеников </li>\r\n            <li>Работа с аудиторией. Постановка голоса, речи. Преодоление страха публичных выступлений\r\n</li>\r\n            <li>Порядок действий при открытии собственной школы. Разработка Вашего бренда.</li>\r\n            <li>Работа над портфолио. Секреты успешных фотографий: ракурс, освещение. Приложения для создания коллажей.</li>\r\n\r\n<li>Ценообразование. Расчет прибыли школы. Особенности местного рынка, ценовая политика в Вашем городе. Идеи для промоакций.</li>\r\n<li>Репутация. Как завоевать доверие учеников и получить положительные отзывы</li>\r\n<li>Рекламная стратегия. Варианты продвижения в интернете. Собственный сайт. Секреты и фишки работы с соцсетями. Правильный пиар в офлайне</li>\r\n<li>Правовые аспекты. Какие документы нужны для открытия школы. Сертификация учеников. Аккредитация. Авторское право.</li>\r\n\r\n\r\n\r\n         </ul>\r\n      </div>\r\n   </div>\r\n\r\n  <div class="right_pop_side">\r\n      <h1>\r\n      Второй день</h2>\r\n      <h3>Практика</h3>\r\n      <div class="right_pop_side_ul">\r\n         <ul>\r\n            <li>Отрисовка и показ всех техник на латексной коже </li>\r\n            <li>Разбор типичных ошибок</li>\r\n            <li>Секреты собственных наработок </li>\r\n            <li>Демонстрация преподавателем всех техник на моделях </li>\r\n            <li>Сдача устного зачета по теории</li>\r\n            <li>Сдача практического зачета на модели </li>\r\n<li>Вручение диплома</li>\r\n<li>Торжественная часть</li>\r\n         </ul>\r\n      </div>\r\n   </div>\r\n</div>', 'Course details Pop Up', '', 'publish', 'closed', 'closed', '', 'course-details-pop-up', '', '', '2018-02-19 20:57:16', '2018-02-19 20:57:16', '', 0, 'https://nahidmahamud.com/portfolio/wordpress/irina/?post_type=popup&#038;p=162', 0, 'popup', '', 0),
